import React, { useEffect } from 'react';
import $ from 'jquery';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
import 'slick-carousel';

function Slider() {
  useEffect(() => {
    $('#containerSlider').slick({
      dots: true,
      infinite: true,
      slidesToShow: 1,
      slidesToScroll: 1,
      autoplay: true,
      autoplaySpeed: 1500
    });
  }, []);

  return (
    <div id="containerSlider">
      <div><img src="https://placehold.co/600x200?text=Slide+1" alt="Slide 1" /></div>
      <div><img src="https://placehold.co/600x200?text=Slide+2" alt="Slide 2" /></div>
      <div><img src="https://placehold.co/600x200?text=Slide+3" alt="Slide 3" /></div>
    </div>
  );
}

export default Slider;
